import React from 'react';
import { Switch, Router, Route } from 'react-router-dom';
import history from './services/history';
import SignIn from './pages/SignIn/SignIn';
import SignUp from './pages/SignUp/SignUp';
import Content from './pages/Home/Content/Content';
import Entries from './pages/Home/Entries/Entries';
import Emotions from './pages/Home/Emotions/Emotions';
import Home from './pages/Home/Paperbase/Paperbase';

function App() {
  return (
    <Router history={history}>
      <Switch>

        <Route path="/register" component={SignUp} />

        <Route path="/home/entries" render={props => <Home {...props} comp={<Entries/>} />}/>
        <Route path="/home/emotions" render={props => <Home {...props} comp={<Emotions/>}/>}  />
        <Route path="/home" render={props => <Home {...props} comp={<Content/>}/>}  isPrivate />
        <Route path="/" exact component={SignIn} />
        <Route component={SignIn} />
    </Switch>
    </Router>
  );
}
export default App;
